import React from "react";

let count = 1;

const IncNum = () => {
  console.log("cliked");
};

const App = () => {
  return (
    <React.Fragment>
      <h1>{count}</h1>
      <button onClick={IncNum}>Click me!</button>
    </React.Fragment>
  );
};

export default App;
